'use strict';

/**
 * @ngdoc function
 * @name projectApp.controller:MainCtrl
 * @description
 * # MainCtrl
 * Controller of the projectApp
 */
angular.module('projectApp')
	.controller('MainCtrl', function($scope, $rootScope, $sce) {



		$scope.editorOptions = {
			theme: 'twilight',
			lineWrapping: true,
			lineNumbers: false,
			mode: "htmlmixed"
		};
		var defaultImage = 'data:image/jpeg;base64,'
		var colorThief = new ColorThief();
		$scope.image;


		function componentToHex(c) {
			var hex = c.toString(16);
			return hex.length == 1 ? "0" + hex : hex;
		}
		$rootScope.style = function(value) {
			return {
				"background-color": value.color,
				width: value.width + "%"
			};
		}


		function rgbToHex(r, g, b) {
			return "#" + componentToHex(r) + componentToHex(g) + componentToHex(b);
		}
		$rootScope.colorBar = [];

		function buildSource() {
			var list = [];
			$scope.subSource;
			list.push('<ul>')
			$rootScope.colorBar.forEach(function(bar, index) {
				list.push('<li style="background-color:' + bar.color + ';width:' + bar.width + '%">');
				list.push('</li>');
			});
			list.push('</ul>');
			$scope.subSource = list.join('');
			$scope.palett = $sce.trustAsHtml(list.join(''));

		}

		function convertToDataURLviaCanvas(url, callback, outputFormat) {
			var img = new Image();
			img.crossOrigin = 'Anonymous';
			img.onload = function() {
				var canvas = document.createElement('CANVAS');
				var ctx = canvas.getContext('2d');
				var dataURL;
				canvas.height = this.height;
				canvas.width = this.width;
				ctx.drawImage(this, 0, 0);
				dataURL = canvas.toDataURL(outputFormat);
				callback(dataURL);
				canvas = null;
			};
			img.src = url;
		}

		function createImageTag(imgData, cb) {
			if (!imgData) return false;

			var img = new Image();
			img.crossOrigin = 'Anonymous';
			img.src = imgData;
			var colors = colorThief.getPalette(img, 5);
			var width = 100 / colors.length;
			colors.forEach(function(color, index) {

				var hex = rgbToHex(color[0], color[1], color[2]);

				$rootScope.colorBar.push({
					color: hex,
					width: width.toFixed(3)
				});
			});
			cb();
		}

		function handleFileSelect(files) {
			var file = files[files.length - 1];

			if (files && file) {
				var reader = new FileReader();

				reader.onloadend = function(readerEvt) {
					createImageTag(reader.result, function() {
						buildSource();
						$rootScope.$apply();
					});

				};
				reader.readAsDataURL(file.file);
			}
		};
		$scope.$on('$dropletReady', function whenDropletReady() {
			$scope.interface.allowedExtensions(['png', 'jpg']);
		});
		$scope.$on('$dropletFileAdded', function whenDropletReady() {
			$rootScope.colorBar = [];
			var files = $scope.interface.getFiles();

			handleFileSelect(files)

		});
		createImageTag(defaultImage, function() {
			buildSource();
		})



	});